folder_path = "pitches/"
pitch_files = sorted(glob.glob(os.path.join(folder_path, "pitch_*.csv")))

for file in pitch_files:

    print(f"Processing {file}")
    df = pd.read_csv(file)

    if len(df) > 7000:
        print("Skipping due to length.")
        continue

    if int(df['speed_mph'].iloc[0]) <= 10:
        print("Skipping due to speed.")
        continue

    # REMOVE CONSECUTIVE DUPLICATE ROWS
    # Columns to check for duplicates (exclude 'timestamp')
    cols_to_check = df.columns.difference(['timestamp'])

    # Remove consecutive duplicates based on selected columns
    df = df.loc[(df[cols_to_check].shift() != df[cols_to_check]).any(axis=1)].reset_index(drop=True)

    if len(df) < 2:
        print("Skipping due to insufficient data after duplicate removal.")
        continue

    if len(df) > 800:
        print("Too long. Skipping")
        continue

    # Extract IMU sensor data
    pitch = df[['Acx0', 'Acy0', 'Acz0', 'Gyx0', 'Gyy0', 'Gyz0',
                'Acx1', 'Acy1', 'Acz1', 'Gyx1', 'Gyy1', 'Gyz1']].values

    acc0 = pitch[:, 0:3]
    gyr0 = np.deg2rad(pitch[:, 3:6])
    acc1 = pitch[:, 6:9]
    gyr1 = np.deg2rad(pitch[:, 9:12])

    # Orientation estimation
    comp0 = Complementary()
    comp1 = Complementary()
    q0 = np.array([1.0, 0.0, 0.0, 0.0])
    q1 = np.array([1.0, 0.0, 0.0, 0.0])
    quats0 = []
    quats1 = []

    for a, g in zip(acc0, gyr0):
        q0 = comp0.update(q=q0, acc=a, gyr=g)
        quats0.append(q0)

    for a, g in zip(acc1, gyr1):
        q1 = comp1.update(q=q1, acc=a, gyr=g)
        quats1.append(q1)

    quats0 = np.array(quats0)
    quats1 = np.array(quats1)

    # Combine features
    features = np.hstack((acc0, gyr0, acc1, gyr1, quats0, quats1))
    speed = df['speed_mph'].iloc[0]

    X.append(features)
    y.append(speed)

