import tensorflow as tf
# Save attention weights every N epochs
attention_over_epochs = {}

class AttentionLogger(tf.keras.callbacks.Callback):
    def __init__(self, sample_input, save_epochs=[1, 10, 50, 100]):
        self.sample_input = sample_input
        self.save_epochs = save_epochs

    def on_epoch_end(self, epoch, logs=None):
        if (epoch + 1) in self.save_epochs:
            attention = self.model(self.sample_input)[1].numpy()  # assumes model output is (pred, attention)
            attention_over_epochs[epoch + 1] = attention[0]  # save only the first sample

