# Select sample to visualize
sample_idx = 1
sample_input = X_test_scaled[sample_idx]  # shape: (timesteps, features)
sample_attention = att_weights[sample_idx]  # shape: (timesteps,)

# Normalize attention weights for color scaling
normalized_attention = (sample_attention - np.min(sample_attention)) / (np.max(sample_attention) - np.min(sample_attention) + 1e-8)

# Multiply sensor data by attention weights to emphasize "important" parts
attended_data = sample_input * normalized_attention[:, np.newaxis]  # (timesteps, features)

